BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "agreement_agreement" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"agrm_id"	varchar(30),
	"agreement_date"	date,
	"tenure_month"	integer,
	"effected_date_as_actual"	date,
	"expiry_date"	date,
	"notice_date"	date,
	"notice_period"	varchar(2) NOT NULL,
	"file_no"	varchar(7) NOT NULL,
	"agreement_advance_amount"	decimal,
	"agreement_security_amount"	decimal,
	"employee_id"	varchar(10) NOT NULL,
	"employee_name"	varchar(30) NOT NULL,
	"employee_designation"	varchar(50) NOT NULL,
	"employee_phone_number"	varchar(15) NOT NULL,
	"employee_email"	varchar(30) NOT NULL,
	"status"	varchar(10) NOT NULL,
	"main_site_id"	integer NOT NULL,
	"properties_id"	integer NOT NULL,
	"total_months"	integer NOT NULL,
	"interest_rate"	decimal,
	"serial_no"	varchar(8) NOT NULL,
	"agreement_cat_type"	varchar(90) NOT NULL,
	"effected_date_as_per_agreement"	date,
	"termination_clause"	varchar(70) NOT NULL,
	"entry_by"	varchar(20) NOT NULL,
	"entry_date"	date,
	"total_rou"	integer,
	FOREIGN KEY("properties_id") REFERENCES "agreement_properties"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("main_site_id") REFERENCES "agreement_site"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "agreement_person" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"name"	varchar(100) NOT NULL,
	"person_type"	varchar(30) NOT NULL,
	"nid"	varchar(20),
	"email"	varchar(40),
	"phone"	varchar(20),
	"address"	varchar(50),
	"name_of_dealing_person"	varchar(50),
	"phone_number_of_dealing_person"	varchar(50),
	"email_of_dealing_person"	varchar(30),
	"relationship"	varchar(30),
	"tin"	varchar(20),
	"dealing_person_status"	varchar(10) NOT NULL,
	"district"	varchar(40) NOT NULL,
	"postcode"	varchar(40) NOT NULL,
	"thana"	varchar(40) NOT NULL,
	"village"	varchar(40) NOT NULL,
	"division"	varchar(40) NOT NULL,
	"entry_by"	varchar(20) NOT NULL,
	"entry_date"	date,
	"sis_supplier_code"	varchar(900) NOT NULL
);
CREATE TABLE IF NOT EXISTS "agreement_rentline" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"rent_rule_no"	varchar(10) NOT NULL,
	"start_period"	date,
	"end_period"	date,
	"rent_per_month"	decimal,
	"agreement_ref_id"	integer,
	"total_months"	integer NOT NULL,
	"advance_agreement_per_month"	decimal,
	"entry_by"	varchar(20) NOT NULL,
	"entry_date"	date,
	FOREIGN KEY("agreement_ref_id") REFERENCES "agreement_agreement"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "agreement_properties" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"type"	varchar(100),
	"desc"	varchar(450),
	"status"	varchar(30),
	"property_size"	integer,
	"district"	varchar(40),
	"division"	varchar(40),
	"percentage_of_first_owner"	integer NOT NULL,
	"percentage_of_second_owner"	integer,
	"percentage_of_third_owner"	integer,
	"percentage_of_fourth_owner"	integer,
	"percentage_of_fifth_owner"	integer,
	"percentage_of_first_site"	integer NOT NULL,
	"percentage_of_second_site"	integer,
	"percentage_of_third_site"	integer,
	"percentage_of_fourth_site"	integer,
	"owner1_id"	integer NOT NULL,
	"owner2_id"	integer,
	"owner3_id"	integer,
	"owner4_id"	integer,
	"owner5_id"	integer,
	"site1_id"	integer NOT NULL,
	"site2_id"	integer,
	"site3_id"	integer,
	"site4_id"	integer,
	"number_of_owner"	integer NOT NULL,
	"number_of_sites"	integer NOT NULL,
	"postcode"	varchar(40),
	"thana"	varchar(40),
	"village"	varchar(40),
	"entry_by"	varchar(20) NOT NULL,
	"entry_date"	date,
	FOREIGN KEY("site1_id") REFERENCES "agreement_site"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("owner5_id") REFERENCES "agreement_person"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("owner4_id") REFERENCES "agreement_person"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("owner3_id") REFERENCES "agreement_person"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("site4_id") REFERENCES "agreement_site"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("owner2_id") REFERENCES "agreement_person"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("site3_id") REFERENCES "agreement_site"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("owner1_id") REFERENCES "agreement_person"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("site2_id") REFERENCES "agreement_site"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "agreement_site" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"site_code"	varchar(4) NOT NULL,
	"site_extension"	integer,
	"display_area"	integer,
	"storage_area_inside"	integer,
	"storage_area_outside"	integer,
	"site_size"	integer,
	"district"	varchar(20) NOT NULL,
	"site_type"	varchar(20) NOT NULL,
	"entry_date"	date,
	"lattitude"	decimal,
	"longitude"	decimal,
	"area"	varchar(20) NOT NULL,
	"entry_by"	varchar(20) NOT NULL
);
CREATE TABLE IF NOT EXISTS "agreement_localarea" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"division"	varchar(40) NOT NULL,
	"district"	varchar(40) NOT NULL,
	"thana"	varchar(40) NOT NULL,
	"postcode"	varchar(40) NOT NULL,
	"village"	varchar(40) NOT NULL
);
CREATE TABLE IF NOT EXISTS "agreement_singerarea" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"district"	varchar(30) NOT NULL,
	"area"	varchar(30) NOT NULL
);
CREATE TABLE IF NOT EXISTS "agreement_advancepaymentline" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"advance_adjustment_rule_no"	varchar(10) NOT NULL,
	"star_period"	date,
	"end_period"	date,
	"advance_adjustment_per_month"	integer,
	"agreement_ref_id"	integer,
	FOREIGN KEY("agreement_ref_id") REFERENCES "agreement_agreement"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_session" (
	"session_key"	varchar(40) NOT NULL,
	"session_data"	text NOT NULL,
	"expire_date"	datetime NOT NULL,
	PRIMARY KEY("session_key")
);
CREATE TABLE IF NOT EXISTS "auth_group" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"name"	varchar(150) NOT NULL UNIQUE
);
CREATE TABLE IF NOT EXISTS "auth_user" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"password"	varchar(128) NOT NULL,
	"last_login"	datetime,
	"is_superuser"	bool NOT NULL,
	"username"	varchar(150) NOT NULL UNIQUE,
	"first_name"	varchar(30) NOT NULL,
	"email"	varchar(254) NOT NULL,
	"is_staff"	bool NOT NULL,
	"is_active"	bool NOT NULL,
	"date_joined"	datetime NOT NULL,
	"last_name"	varchar(150) NOT NULL
);
CREATE TABLE IF NOT EXISTS "auth_permission" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"content_type_id"	integer NOT NULL,
	"codename"	varchar(100) NOT NULL,
	"name"	varchar(255) NOT NULL,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_content_type" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"app_label"	varchar(100) NOT NULL,
	"model"	varchar(100) NOT NULL
);
CREATE TABLE IF NOT EXISTS "agreement_securityline" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"security_line_id"	varchar(10) NOT NULL,
	"from_line_date"	date,
	"to_line_date"	date,
	"total_line_amount"	integer,
	"agreement_ref_id"	integer NOT NULL,
	FOREIGN KEY("agreement_ref_id") REFERENCES "agreement_agreement"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_admin_log" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"action_time"	datetime NOT NULL,
	"object_id"	text,
	"object_repr"	varchar(200) NOT NULL,
	"change_message"	text NOT NULL,
	"content_type_id"	integer,
	"user_id"	integer NOT NULL,
	"action_flag"	smallint unsigned NOT NULL CHECK("action_flag">=0),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"user_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"user_id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"group_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_migrations" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"app"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"applied"	datetime NOT NULL
);
